import React from 'react';
import { useStyles } from './styles';
import { cardElevation } from '../../../styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import { Card, Grid } from '@material-ui/core';
import Box from '@material-ui/core/Box';
import Typography from '@material-ui/core/Typography';

export default function ContinuingEducation(props) {
  const classes = useStyles();
  let { ce2020, ce2021 } = props;

  const sortByMonth = (arr) => {
    return arr.sort((a, b) => {
      return a['month'] - b['month'];
    });
  };

  ce2020 = sortByMonth(ce2020);
  ce2021 = sortByMonth(ce2021);

  let upcomingEvents = ce2021.filter(event => {
    return event['Status'] != 'Completed' && !event['Status'].includes('Can')
  })

  let pastEvents = ce2020.concat(ce2021)
  pastEvents.filter(event => {
    return event['Status'].includes('Comp')
  })
  pastEvents.sort((a, b) => {
    return b['month'] - a['month'];
  })

  return (
    <Box marginTop={3}>
      <Card elevation={0}>
      <Typography className={classes.title}>
        Continuing Education
      </Typography>
      <Box margin={10} marginTop={'5rem'}>
        <Typography className={classes.subtitle}>
          Upcoming Events
        </Typography>
        <TableContainer className={classes.root} >
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Date</TableCell>
                <TableCell>Class</TableCell>
                <TableCell>Status</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {upcomingEvents.map(row => (
                <TableRow key={row['Date']}>
                  <TableCell component='th' scope='row'>{row['Date']}</TableCell>
                  <TableCell>{row['Class']}</TableCell>
                  <TableCell>{row['Status']}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </Box>
        <Box minHeight={330} margin={10} marginTop={'-2rem'}>
          <Typography className={classes.subtitle}>
            Recent Events
          </Typography>
          <TableContainer className={classes.root} >
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>Date</TableCell>
                  <TableCell>Class</TableCell>
                  <TableCell>Status</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {upcomingEvents.map(row => (
                  <TableRow key={row['Date']}>
                    <TableCell component='th' scope='row'>{row['Date']}</TableCell>
                    <TableCell>{row['Class']}</TableCell>
                    <TableCell>{row['Status']}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </Box>
      </Card>
    </Box>
  );
}
